  false,\n\t\"url\": null,\n\t\"notes\": \"Drainage of swamplands and increases in
  high-yield agricultural pumping in southeast Missouri over a 30 year period may
  have affected water table depths and potentially altered the risk of subsequent
  liquefaction following an earthquake. It was unknown if recent high-yield pumping
  has affected depth to groundwater extensively in the study area. The purpose of
  this map is to provide a basis for comparison between static water levels (SWL)
  prior to 1971 and those of present day (2000 and later). Depths to groundwater were
  determined using existing well log data.\",\n\t\"license_title\": null,\n\t\"extras\":
